import React from 'react';
import {  Route, Routes } from 'react-router-dom';
import Presentational from './component/presentational/Presentational';

const App = () => {
  return (
      <Routes>
        <Route path="/*" element={<Presentational />} />
      </Routes>
  );
};

export default App;
